@media screen and (max-width: 767px) {
  .modal {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    width: 288px;
    min-height: 623px;
    padding-left: 17px;
    padding-right: 17px;
    padding-top: 72px;
    padding-bottom: 24px;
    border-radius: 4px;
    background-color: #fcfcfc;
    margin-top: 30px;
    margin-bottom: 12px;
    box-shadow: 0px 1px 1px rgba(0, 0, 0, 0.14), 0px 1px 3px rgba(0, 0, 0, 0.12),
      0px 2px 1px rgba(0, 0, 0, 0.2);
    transition: transform 250ms cubic-bezier(0.4, 0, 0.2, 1);
  }

  .close-btn {
    position: absolute;
    top: 24px;
    right: 24px;
    line-height: 0;
    padding: 0;
    stroke: #111111;
    top: 24px;
    right: 24px;
    line-height: 0;
    padding: 0;
    stroke: #111111;
    width: 24px;
    height: 24px;
    border-radius: 50%;
    display: flex;
    align-items: center;
    justify-content: center;
    background-color: #e7e9fc;
    border: 1px solid rgba(0, 0, 0, 0.1);
    cursor: pointer;
    transition: background-color 250ms cubic-bezier(0.4, 0, 0.2, 1),
      border 250ms cubic-bezier(0.4, 0, 0.2, 1);
  }

  .close-btn:hover,
  .close-btn:focus {
    border: none;
    background-color: var(--color-active);
    fill: #ffffff;
  }

  .close-btn-icon {
    transition: fill 250ms cubic-bezier(0.4, 0, 0.2, 1);
  }
  .review-form-description {
    width: 256px;
    font-size: 16px;
    font-weight: 500;
    line-height: 1.5;
    letter-spacing: 0.02em;
    text-align: center;
    color: var(--color-primary);
    margin-bottom: 16px;
  }

  .review-form-field-wrapper {
    margin-bottom: 8px;
    height: auto;
  }
  .div-comment {
    margin-bottom: 16px;
  }

  .review-form-field-label {
    display: block;
    font-size: 12px;
    font-weight: 400;
    letter-spacing: 0.04em;
    color: #8e8f99;
    margin-bottom: 4px;
    line-height: 1.17;
  }

  .review-form-input-wrapper {
    position: relative;
  }

  .review-form-input {
    width: 100%;
    height: 40px;
    border-radius: 4px;
    border: 1px solid rgba(46, 47, 66, 0.4);
    padding-left: 38px;
    transition: background-color 250ms cubic-bezier(0.4, 0, 0.2, 1);
    background-color: transparent;
    outline: transparent;
    transition: border-color 250ms cubic-bezier(0.4, 0, 0.2, 1);
  }

  .review-form-input:focus {
    border-color: var(--color-brand);
    outline: transparent;
  }

  .review-form-field-icon {
    position: absolute;
    top: 50%;
    left: 16px;
    transform: translateY(-50%);
    fill: var(--color-primary);
    transition: fill 250ms cubic-bezier(0.4, 0, 0.2, 1);
  }

  .review-form-input:focus + .review-form-field-icon {
    fill: var(--color-brand);
  }

  .review-form-comment {
    width: 100%;
    height: 120px;
    font-size: 12px;
    font-weight: 360;
    letter-spacing: 0.04em;
    color: rgba(46, 47, 66, 0.4);
    padding: 8px 16px;
    border-radius: 4px;
    border: 1px solid rgba(46, 47, 66, 0.4);
    resize: none;
    transition: border-color 250ms cubic-bezier(0.4, 0, 0.2, 1);
    line-height: 1.17;
    background-color: transparent;
    outline: transparent;
  }

  .review-form-comment::placeholder {
    color: rgba(64, 64, 64, 0.3);
  }

  .review-form-comment:focus {
    border-color: var(--color-brand);
    outline: transparent;
  }

  .review-form-checkbox-wrapper {
    margin-bottom: 24px;
  }

  .review-form-checkbox-label {
    font-size: 12px;
    font-weight: 400;
    letter-spacing: 0.04em;
    color: #8e8f99;
    line-height: 1.17;
    width: 256px;
  }

  .review-form-own-checkbox {
    display: inline-flex;
    justify-content: center;
    align-items: center;
    width: 16px;
    height: 16px;
    border: 1px solid rgba(46, 47, 66, 0.4);
    border-radius: 2px;
    cursor: pointer;
    fill: transparent;
    margin-right: 12px;

    transition: background-color 250ms cubic-bezier(0.4, 0, 0.2, 1),
      border 250ms cubic-bezier(0.4, 0, 0.2, 1),
      fill 250ms cubic-bezier(0.4, 0, 0.2, 1);
  }

  .review-form-checkbox:checked
    + .review-form-checkbox-label
    > .review-form-own-checkbox {
    background-color: var(--color-active);
    fill: var(--color-light);
    border: none;
  }

  .review-form-checkbox:focus
    + .review-form-checkbox-label
    > .review-form-own-checkbox {
    outline: 2px solid rgba(0, 0, 255, 0.5);
  }
  .review-form-privacy {
    text-decoration: underline;
    color: var(--color-brand);
  }
  .review-form-submit {
    display: block;
    min-width: 169px;
    height: 56px;
    font-size: 16px;
    font-weight: 500;
    line-height: 1.5;
    letter-spacing: 0.04em;
    padding: 16px 32px;
    color: #ffffff;
    background-color: var(--color-brand);
    border-radius: 4px;
    border: none;
    text-align: center;
    margin-left: 59px;
    margin-right: 60px;
    margin-bottom: 24px;
    transition: background-color 250ms cubic-bezier(0.4, 0, 0.2, 1);
  }

  .review-form-submit:hover,
  .review-form-submit:focus {
    background-color: var(--color-active);
  }
}

